    name: "Masaje t\u00e1ntrico + Limpieza facial profunda",
    slug: "masaje-tantrico-limpieza-facial-profunda",
    permalink:
      "https://calyaan.com/producto/masaje-tantrico-limpieza-facial-profunda/",
    date_created: "2023-05-10T22:27:48",
    date_created_gmt: "2023-05-11T03:27:48",
